question:
Question: An aluminum ion has a charge of +3, and an oxide ion has a charge of -2. Which would be the product of a reaction between these two elements?
Choices:
A. Al_{2}O
B. Al_{2}O_{3}
C. 2AlO_{3}
D. Al_{3}O_{2}

Question: Magnesium bromide is one of the most abundant compounds found in sea water. Which formula correctly represents magnesium bromide?
Choices:
A. MgBr
B. MgBr_{2}
C. Mg_{2}Br
D. Mg_{3}Br_{2}

Question: If HCl is added to Zn, what would be an expected product?
Choices:
A. Cl_{2}
B. HZn
C. ZnCl
D. ZnCl_{2}

Question: Which of the following represents the process of photosynthesis?
Choices:
A. C_{6}H_{12}O_{6} -> 6CO_{2} + 6H_{2}O
B. 6CO_{2} + 6H_{2}O -> C_{6}H_{12}O_{6} +6O_{2}
C. 2H_{2}O -> 2H_{2} + O_{2}
D. 2H_{2} + O_{2} -> 2H_{2}O

Question: Photosynthesis is a process involving carbon dioxide, water, glucose, oxygen, and sunlight. Which is the correct chemical equation for photosynthesis?
Choices:
A. O_{2} + H_{2}O + energy -> C_{6}H_{12}O_{6} + CO_{2}
B. CO_{2} + H_{2}O -> C_{6}H_{6}O_{3} + O_{2} + energy
C. 6O_{2} + 6H_{2}O -> C_{6}H_{12}O_{6} + 6CO_{2} + energy
D. 6CO_{2} + 6H_{2}O + energy -> C_{6}H_{12}O_{6} + 6O_{2}

Question: Significant destruction of a forest habitat will increase which gas in the atmosphere?
Choices:
A. CO_{2}
B. NO_{2}
C. O_{2}
D. N_{2}
